IQEu0Mbe4x1gjU5FzD1vqCTlDvPB7EI6RNWvHdRsUJxg5gw=/0/0/0/video.3gp' type='video/3gpp' medium='video' expression='full' duration='70' yt:format='6'/><media:credit role='uploader' scheme='urn:youtube' yt:display='bigbabypooch' yt:type='partner'>bigbabypooch</media:credit><media:description type='plain'>Whitney Houston, who reigned as pop music's queen until her majestic voice and regal image were ravaged by drug use, has died. She was 48. Publicist Kristen Foster said Saturday that the singer had died, but the cause and the location of her death were unclear. At her peak in the 1980s and `90s, Houston the golden girl of the music industry and one of the world's best-selling artists. Among her hits were \"How Will I Know,\" \"Saving All My Love for You\" and \"I Will Always Love You.\" She won multiple Grammys including album and record of the year. Her success carried her beyond music to movies like \"The Bodyguard.\" But by the end of her career, drug use took its toll as her record sales plummeted and her voice became raspy and hoarse. Before Super Bowl XXV and in midst of the Persian Gulf War, Houston sang the national anthem, which has since been heralded as one of the best performances in the history of the event.</media:description><media:keywords>whitney houston last, whitney houston, last performance, yes jesus loves me, footage, final, hours, last known, I will always love you, I wanna dance with somebody, greatest love of all, facebook parenting, dad shoots, laptop, Michel, Tel\xC3\xB3, Ai, Se, Eu, Te, Pego, lil wayne, bruno mars, grammies, grammys, grammy, 2012, etta james, adele, mariah, carey, bodyguard, costner, grammy awards 2012, grammys 2012, HD, 720p</media:keywords><media:license type='text/html' href='http://www.youtube.com/t/terms'>youtube</media:license><media:player url='http://www.youtube.com/watch?v=Jt2g0tQBTcg&amp;feature=youtube_gdata_player'/><media:thumbnail url='http://i.ytimg.com/vi/Jt2g0tQBTcg/default.jpg' height='90' width='120' time='00