lay='MasterMarketer1000' yt:type='partner'>mastermarketer1000</media:credit><media:description type='plain'>Police have confirmed that Whitney Houston died at the Beverly Hills Hotel in Los Angeles this afternoon.A detective from the Los Angeles Police Department says police received a 911 call at 3.23pm LA-time (12.23 NZ-time) from a member of Houston's entourage. Speaking at a press conference, Mark Rosen said police arrived at the fourth floor room within two minutes, and found members of Houston's entourage and hotel staff attempting resuscitation. The 48-year-old singer was pronounced dead at 3.55pm local time. Rosen says detectives are working to determine whether it was natural death or whether there are any suspicious circumstances. He said it is too early to say whether there were any signs of drug use. Website TMZ has reported the presence of a police crime lab vehicle outside the hotel. Rosen said that Houston's body remains in the hotel room. Houston was staying at the hotel which was to be the scene of an annual pre-Grammy party hosted by Clive Davis, the music industry figure who discovered Whitney Houston. The 48-year-old singer won six Grammy Awards, two Emmy Awards, 30 Billboard Music Awards, 22 American Music Awards during her record-breaking career. Houston, inspired by soul singers in her New Jersey family, including mother Cissy Houston and cousins Dionne Warwick and the late Dee Dee Warwick, as well as her godmother Aretha Franklin, became one of the most celebrated female singers of all time. Her popularity soared in the 1980s and 1990s with consecutive &lt;b&gt;...&lt;/b&gt;</media:description><media:keywords>Whitney Houston, Dies, Breaking News, Mariah Carey, grammy awards, Grammy Award, Fox, Mtv, Bbc, Fox Broadcasting Company, vh1, hot, pop, madonna, cnn, fox news, wtc</media:keywords><media:license type='text/html' href='http://www.youtube.com/t/terms'>youtube</media:license><media:player url='http://www.youtube.com/watch?v=n49ilkYpvG4&amp